INSERT INTO `receta` (`id_receta`, `nombre`, `descripcion`, `ruta_imagen`, `tienda_id`, `veces_pedida`, `pasos`) VALUES
(1, 'Bizcochuelo de Vainilla', 'Bizcochuelo esponjoso ideal para postres.', 'receta/1.jpg', 67, 92, 'Tamizar la harina, el polvo de hornear y la sal en un bol. || En otro recipiente, batir los huevos con el azúcar hasta obtener una mezcla espumosa. || Agregar la esencia de vainilla y la leche, batiendo bien para integrar. || Incorporar la mezcla de harina poco a poco, batiendo hasta eliminar grumos. || Fundir la manteca y añadirla a la preparación, mezclando hasta homogeneizar. || Verter la masa en un molde engrasado. || Hornear a 180°C por 30 minutos o hasta que al insertar un palillo, este salga limpio. || Retirar del horno y dejar enfriar antes de desmoldar.'),
(2, 'Panqueques Americanos', 'Panqueques esponjosos para el desayuno.', 'receta/2.jpg', 43, 14, 'Tamizar la harina con el polvo de hornear y el azúcar en un bol. || En otro recipiente, batir los huevos y agregar la leche, mezclando bien. || Incorporar la mezcla de harina poco a poco, batiendo hasta integrar completamente. || Fundir la manteca y añadirla, removiendo para distribuirla bien. || Calentar una sartén antiadherente a fuego medio y engrasarla ligeramente. || Verter una porción de la mezcla en la sartén y cocinar hasta que aparezcan burbujas en la superficie. || Voltear con una espátula y cocinar hasta dorar por el otro lado. || Retirar y repetir el proceso hasta terminar la mezcla. || Servir caliente con miel, frutas o el acompañamiento deseado.'),
(3, 'Pizza Margarita', 'Pizza casera con masa fina y queso derretido.', 'receta/3.jpg', 78, 37, 'Tamizar la harina en un bol y agregar la levadura y la sal. || Incorporar el agua poco a poco, amasando hasta obtener una masa suave y elástica. || Dejar reposar cubierta durante 1 hora o hasta que duplique su tamaño. || Estirar la masa sobre una superficie enharinada hasta lograr el grosor deseado. || Esparcir salsa de tomate sobre la masa y distribuir el queso mozzarella de manera uniforme. || Agregar un toque de aceite de oliva y hornear a 200°C por 15-20 minutos o hasta que el queso se derrita y la masa esté dorada. || Retirar del horno y servir caliente.'),
(4, 'Milanesa de Carne', 'Clásica milanesa empanizada.', 'receta/4.jpg', 55, 85, 'Cortar la carne en porciones individuales y marinar con sal y condimentos al gusto. || Pasar cada pieza por harina y sacudir el exceso. || Sumergir en huevo batido con una pizca de sal. || Rebozar con pan rallado presionando bien para que se adhiera. || Calentar aceite en una sartén profunda. || Freír cada milanesa hasta que esté dorada por ambos lados. || Retirar y colocar sobre papel absorbente para eliminar el exceso de aceite. || Servir caliente acompañada de puré o ensalada.'),
(5, 'Tarta de Espinaca', 'Tarta salada con espinaca y queso.', 'receta/5.jpg', 81, 23, 'Lavar y escurrir bien las hojas de espinaca. || Saltear la espinaca con un poco de aceite hasta que reduzca su volumen. || En un bol, mezclar espinaca, queso rallado, huevos, sal y pimienta. || Forrar un molde con masa de tarta y pinchar la base con un tenedor. || Verter la mezcla sobre la masa y distribuir uniformemente. || Hornear a 180°C durante 30 minutos o hasta que la superficie esté dorada. || Retirar del horno y dejar reposar antes de servir.'),
(6, 'Hamburguesa Clásica', 'Hamburguesa casera con carne, queso y vegetales.', 'receta/6.jpg', 69, 51, 'En un bol, mezclar carne molida con sal, pimienta y condimentos al gusto. || Formar hamburguesas del tamaño deseado. || Calentar una sartén o parrilla con un poco de aceite. || Cocinar cada hamburguesa hasta que esté dorada por ambos lados. || Colocar una rebanada de queso sobre la hamburguesa caliente para que se derrita. || Armar la hamburguesa en pan con tomate, lechuga y cebolla. || Servir caliente con papas fritas o ensalada.'),
(7, 'Guiso de Carne con Papas', 'Guiso reconfortante con carne y verduras.', 'receta/7.jpg', 47, 68, 'Cortar la carne en trozos medianos y sellarla en una olla con aceite caliente. || Agregar la cebolla, zanahoria y ajo picados, y saltear por unos minutos. || Incorporar las papas en cubos y mezclar. || Añadir agua o caldo hasta cubrir todos los ingredientes. || Condimentar con sal, pimienta y especias al gusto. || Cocinar a fuego bajo hasta que las papas estén blandas y la carne tierna. || Servir caliente acompañado de pan.'),
(8, 'Empanadas de Jamón y Queso', 'Empanadas doradas rellenas de jamón y queso.', 'receta/8.jpg', 61, 89, 'Cortar el jamón en trozos pequeños y mezclar con queso rallado. || Estirar la masa de empanada y colocar una porción del relleno en el centro. || Humedecer los bordes de la masa con agua y cerrar formando una media luna. || Presionar los bordes con un tenedor para sellar bien. || Hornear a 200°C hasta que estén doradas. || Retirar y dejar enfriar un poco antes de servir.'),
(9, 'Sopa de Verduras', 'Sopa nutritiva con verduras frescas.', 'receta/9.jpg', 76, 5, 'Picar la papa, zanahoria, cebolla, tomate y pimiento en cubos pequeños. || Calentar agua en una olla y agregar todas las verduras picadas. || Añadir ajo machacado y sal al gusto. || Cocinar a fuego medio hasta que las verduras estén bien cocidas. || Servir caliente acompañado de pan o crutones.'),
(10, 'Pasta con Salsa de Tomate', 'Fideos al dente con salsa casera.', 'receta/10.jpg', 50, 34, 'Cocinar la pasta en agua hirviendo con sal hasta que esté al dente. || Mientras tanto, calentar aceite en una sartén y añadir ajo picado. || Agregar salsa de tomate y condimentar con sal, pimienta y orégano. || Cocinar a fuego bajo hasta que espese. || Mezclar la pasta con la salsa y servir caliente.'),
(11, 'Ensalada César', 'Ensalada fresca con lechuga, queso y crutones.', 'receta/11.jpg', 80, 63, 'Lavar bien las hojas de lechuga y cortarlas en trozos. || Cortar el queso en cubos pequeños. || Preparar los crutones tostando cubos de pan en una sartén con un poco de aceite y ajo. || Mezclar todos los ingredientes en un bol grande. || Aderezar con salsa César al gusto y mezclar bien antes de servir.'),
(12, 'Pollo al Ajillo', 'Pollo dorado con aroma de ajo.', 'receta/12.jpg', 45, 41, 'Cortar el pollo en trozos medianos. || Picar finamente el ajo y la cebolla. || Calentar aceite en una sartén y dorar los trozos de pollo por todos lados. || Agregar el ajo y la cebolla picados, y saltear hasta que estén fragantes. || Sazonar con sal y pimienta al gusto. || Cocinar a fuego medio hasta que el pollo esté completamente cocido. || Servir caliente acompañado de arroz o papas.'),
(13, 'Carne Molida a la Italiana', 'Carne molida con toque mediterráneo.', 'receta/13.jpg', 71, 74, 'Calentar aceite en una sartén grande. || Agregar la carne molida y cocinar hasta que esté dorada. || Incorporar el ajo y la cebolla picados y saltear hasta que estén tiernos. || Agregar los tomates en cubos y cocinar a fuego bajo. || Condimentar con orégano, albahaca, sal y pimienta. || Cocinar hasta que la salsa espese. || Servir sobre pasta o acompañada de pan.'),
(14, 'Fideos a la Boloñesa', 'Pasta con salsa de carne tradicional.', 'receta/14.jpg', 53, 29, 'Cocinar la pasta en abundante agua hirviendo con sal hasta que esté al dente. || Mientras tanto, calentar aceite en una sartén y dorar la carne molida. || Agregar ajo y cebolla picados, y cocinar hasta que estén tiernos. || Incorporar tomate triturado y condimentar con orégano, sal y pimienta. || Cocinar a fuego medio hasta que la salsa espese. || Mezclar con los fideos y servir caliente.'),
(15, 'Pollo a la Parrilla', 'Pollo jugoso con sazón mediterráneo.', 'receta/15.jpg', 79, 88, 'Cortar el pollo en porciones individuales. || Marinar con sal, aceite de oliva, ajo y orégano. || Dejar reposar por al menos 30 minutos. || Calentar la parrilla y cocinar el pollo por ambos lados hasta que esté dorado. || Servir caliente con ensalada o verduras asadas.'),
(16, 'Estofado de Res', 'Res estofada con verduras de temporada.', 'receta/16.jpg', 58, 12, 'Cortar la carne en trozos grandes y dorarla en una olla con aceite caliente. || Agregar la cebolla y zanahoria picadas, y cocinar unos minutos. || Incorporar las papas en cubos y cubrir con caldo o agua. || Condimentar con sal, pimienta y especias al gusto. || Cocinar a fuego bajo hasta que la carne esté tierna y las verduras bien cocidas. || Servir caliente con arroz o pan.'),
(17, 'Wrap de Pollo y Lechuga', 'Wrap ligero con pollo asado y vegetales frescos.', 'receta/17.jpg', 63, 57, 'Cocinar el pollo a la plancha hasta que esté dorado. || Cortar la lechuga, tomate y queso en tiras delgadas. || Calentar ligeramente el pan de wrap. || Colocar el pollo y los vegetales sobre el pan. || Enrollar firmemente y cortar por la mitad. || Servir frío o caliente acompañado de aderezos.'),
(18, 'Tortilla de Papas', 'Clásica tortilla española.', 'receta/18.jpg', 74, 93, 'Pelar las papas y cortarlas en rodajas finas. || Picar la cebolla en trozos pequeños. || Calentar aceite en una sartén y dorar las papas y cebolla hasta que estén tiernas. || En un bol, batir los huevos con sal. || Incorporar las papas y mezclar bien. || Verter la mezcla en la sartén y cocinar a fuego bajo hasta que cuaje. || Dar vuelta la tortilla con un plato y cocinar por el otro lado. || Servir caliente o fría.'),
(19, 'Crema de Champiñones', 'Sopa cremosa con champiñones frescos.', 'receta/19.jpg', 49, 20, 'Lavar y cortar los champiñones en trozos pequeños. || Picar la cebolla y el ajo. || Calentar manteca en una olla y dorar los champiñones con la cebolla y el ajo. || Agregar la papa en cubos y cubrir con caldo de verduras. || Cocinar hasta que los ingredientes estén tiernos. || Licuar hasta obtener una crema homogénea. || Servir caliente con crutones.'),
(20, 'Omelette de Queso', 'Omelette esponjoso relleno de queso.', 'receta/20.jpg', 81, 36, 'Batir los huevos en un bol con sal y pimienta. || Calentar manteca en una sartén a fuego medio. || Verter los huevos y cocinar hasta que comiencen a cuajar. || Espolvorear queso rallado sobre la mitad del omelette. || Doblar la otra mitad sobre el queso y cocinar unos minutos más. || Servir caliente acompañado de pan tostado.'),
(21, 'Croissant de Jamón y Queso', 'Croissant dorado con relleno sabroso.', 'receta/21.jpg', 56, 46, 'Cortar el jamón en tiras y el queso en cubos pequeños. || Cortar los croissants por la mitad sin separarlos completamente. || Rellenar con el jamón y el queso distribuyéndolos uniformemente. || Precalentar el horno a 180°C. || Colocar los croissants en una bandeja y hornear durante 5-7 minutos o hasta que el queso se derrita. || Servir caliente.'),
(22, 'Quiche de Espinaca', 'Quiche salado con espinaca y queso.', 'receta/22.jpg', 68, 88, 'Lavar y escurrir la espinaca, picándola finamente. || En un bol, mezclar la espinaca con los huevos, queso rallado, leche y sal. || Forrar un molde con masa quebrada y pinchar la base con un tenedor. || Verter la mezcla en el molde y distribuir uniformemente. || Hornear a 180°C durante 30-35 minutos hasta que el quiche esté dorado. || Retirar del horno y dejar reposar antes de servir.'),
(23, 'Filete a la Plancha', 'Filete de res sazonado y asado a la perfección.', 'receta/23.jpg', 44, 12, 'Seleccionar filetes de res y sazonarlos con sal y pimienta. || Calentar una plancha o sartén con un poco de aceite. || Colocar los filetes y cocinar a fuego alto por 2-3 minutos de cada lado para sellarlos. || Reducir el fuego y cocinar hasta alcanzar el punto de cocción deseado. || Servir caliente acompañado de verduras o papas.'),
(24, 'Salteado de Verduras', 'Salteado colorido con variedad de verduras.', 'receta/24.jpg', 77, 71, 'Lavar y cortar las verduras en tiras o cubos pequeños. || Calentar aceite en una sartén grande. || Agregar zanahoria y pimiento, salteando por unos minutos. || Incorporar champiñones, cebolla y ajo picados y cocinar hasta que estén tiernos. || Condimentar con sal y especias al gusto. || Servir caliente acompañado de arroz o fideos.'),
(25, 'Spaghetti al Ajo y Aceite', 'Pasta sencilla con ajo y aceite de oliva.', 'receta/25.jpg', 59, 31, 'Cocinar los spaghetti en agua hirviendo con sal hasta que estén al dente. || Mientras tanto, calentar aceite de oliva en una sartén. || Agregar ajo picado y cocinar hasta que esté dorado. || Incorporar los spaghetti escurridos y mezclar bien. || Añadir orégano y ajustar la sal. || Servir caliente con queso rallado.'),
(26, 'Ratatouille', 'Estofado mediterráneo de verduras.', 'receta/26.jpg', 66, 97, 'Lavar y cortar los tomates, zanahoria, pimiento, cebolla y ajo en cubos pequeños. || Calentar aceite en una olla grande. || Saltear la cebolla y el ajo hasta que estén fragantes. || Incorporar los demás vegetales y cocinar a fuego bajo. || Condimentar con orégano y sal. || Cocinar hasta que las verduras estén tiernas. || Servir caliente.'),
(27, 'Chili con Carne', 'Plato picante con carne y vegetales.', 'receta/27.jpg', 48, 48, 'Picar la cebolla, ajo y pimiento en trozos pequeños. || Calentar aceite en una sartén y dorar la carne molida. || Agregar la cebolla, ajo y pimiento picados, salteando por unos minutos. || Incorporar tomate triturado y condimentar con sal, pimienta y un toque de picante. || Cocinar a fuego bajo hasta que la salsa espese. || Servir caliente acompañado de arroz.'),
(28, 'Caldo de Pollo', 'Caldo reconfortante para días fríos.', 'receta/28.jpg', 72, 3, 'Lavar y cortar el pollo en trozos grandes. || Picar la papa, zanahoria, cebolla y ajo en cubos pequeños. || Hervir agua en una olla grande y añadir el pollo y las verduras. || Condimentar con sal y dejar cocinar a fuego bajo. || Cocinar hasta que el pollo esté bien cocido y las verduras tiernas. || Colar el caldo y servir caliente.'),
(29, 'Sándwich de Jamón y Queso', 'Sándwich clásico para cualquier ocasión.', 'receta/29.jpg', 54, 60, 'Cortar el pan y colocar una rebanada de jamón y queso en cada mitad. || Agregar tomate y lechuga si se desea. || Cerrar el sándwich y presionar suavemente. || Servir frío o calentar en una plancha hasta que el queso se derrita.'),
(30, 'Panqueques Integrales', 'Panqueques nutritivos con harina integral.', 'receta/30.jpg', 75, 25, 'Tamizar la harina integral con el polvo de hornear y el azúcar en un bol. || En otro recipiente, batir los huevos con la leche. || Incorporar la mezcla de harina poco a poco, batiendo hasta integrar completamente. || Fundir la manteca y añadirla, removiendo bien. || Calentar una sartén antiadherente a fuego medio y engrasarla ligeramente. || Verter una porción de la mezcla y cocinar hasta que aparezcan burbujas en la superficie. || Voltear con una espátula y cocinar hasta dorar. || Retirar y repetir hasta terminar la mezcla. || Servir caliente con miel o frutas.'),
(32, 'Pan con manteca', 'Simple y Deliciosa opcion para desayunos y meriendas.', 'receta/685a9cea0509e.jpg', 43, 0, 'Cortar el pan en rodajas de 1 pulgada aproximadamente||Untar las rodajas de pan con mateca a gusto'),
(33, 'Pan con manteca', 'Simple y Deliciosa opcion para desayunos y meriendas.', 'receta/685a9e181bc37.jpg', 43, 0, 'Cortar el pan en rodajas de 1 pulgada aproximadamente||Untar las rodajas de pan con mateca a gusto'),
(34, 'Pancho', 'Clasica receta rapido y deliciosa , ideal para grandes reuniones o fiestas infantiles.', 'receta/685aa627586ce.jpg', 43, 0, 'colocar en una olla con agua las salchichas a fuego medio||cortar los panes por el centro||dejar hervir por un minuto las salchicas y colocarlas en los panes||colocar aderezos a eleccion '),
(38, 'Yogurth con Granola', 'ideal para mediendas y desayunos', 'receta/685b19124c175.jpg', 36, 0, 'servir el yogurth||agregar la granola||mezclar');
